import CardMedia from "@mui/material/CardMedia";
import CardContent from "@mui/material/CardContent";
import Typography from "@mui/material/Typography";
import CardActions from "@mui/material/CardActions";
import Button from "@mui/material/Button";
import Card from "@mui/material/Card";
import * as React from "react";
import { FC } from "react";
import {
  Avatar,
  Container,
  Grid,
  Dialog,
  DialogContent,
  DialogActions, Link,
} from "@mui/material";
import { BootstrapDialogTitle } from "../../BootstrapDialogTitle";
import { ProductComponent } from "../../../services/api";

interface ProductComponentProps {
  productComponents: ProductComponent[];
}

export const BoxComponentPreview: FC<ProductComponentProps> = ({
  productComponents,
}) => {
  const [open, setOpen] = React.useState(false);

  const handleClickOpen = () => {
    setOpen(true);
  };
  const handleClose = () => {
    setOpen(false);
  };

  return (
    <Container>
      <Card>
        <CardContent>
          <Typography variant="h2" color="text.secondary">
            Компоненты
          </Typography>
          <Grid container spacing={2}>
            {productComponents?.length &&
              productComponents.map(({ name, ci, repoLink, stack }) => (
                <Grid item key={ci}>
                  <Button
                    variant="outlined"
                    size="large"
                    onClick={handleClickOpen}
                  >
                    {name}
                  </Button>
                  <Dialog
                    onClose={handleClose}
                    aria-labelledby="customized-dialog-title"
                    open={open}
                  >
                    <BootstrapDialogTitle
                      id="customized-dialog-title"
                      onClose={handleClose}
                    >
                      Компонент {name}
                    </BootstrapDialogTitle>
                    <DialogContent dividers>
                      <Typography gutterBottom>КЭ: {ci}</Typography>
                      <Link href={repoLink}>Ссылка на репозиторий</Link>
                      <Typography gutterBottom>
                        Тех.Стек: {JSON.stringify(stack)}
                      </Typography>
                    </DialogContent>
                  </Dialog>
                </Grid>
              ))}
          </Grid>
        </CardContent>
      </Card>
    </Container>
  );
};
